import React, { Component } from "react";
import {
  StyleSheet,
  View,
  StatusBar,
  Text,
  TextInput,
  TouchableOpacity,
  ScrollView,
} from "react-native";
import Ticket from "./components/Ticket";

const Game = () => {
  return (
    <View style={styles.mainContainer}>
      <View>
        <PreviousNumber />
      </View>
      <View style={styles.ticketContainer}>
        <Ticket style={styles.ticket} />
      </View>
    </View>
  );
};
const styles = StyleSheet.create({
  mainContainer: {
    flex: 1,
    alignContent: "center",
    justifyContent: "center",
    backgroundColor: "#E6E6E6",
  },
  ticket: {
    width: "100%",
    height: 200,
    borderRadius: 10,
  },
  ticketContainer: {
    margin: 10,
  },
});

export default Game;
